import React from "react";

const AboutMe = () => {
  return (
    <div>
        <h2 style={{fontSize:"50px"}}>About Me</h2>
    <div className="about-me">
      <div className="left-box">
        <img
          className="profile-img"
          style={{ height: "400px" }}
          src="/profile2.png"
        ></img>
      </div>
      <div className="right-box">
        I am a passionate software engineer hailing from India, with a Master's
        degree in Computer Applications from NIT Jamshedpur. My expertise spans
        across various domains including full-stack development, machine
        learning, network security, and DevOps. With a fervent enthusiasm for
        learning, I have embarked on numerous projects encompassing these
        diverse technological stacks. I thrive on crafting high-quality software
        solutions that hold the potential to make a significant impact on
        people's lives. Eager to contribute to meaningful projects and driven by
        innovation, I am dedicated to pushing the boundaries of what technology
        can achieve. Let's collaborate and build something remarkable together!
      </div>
    </div>
    </div>
  );
};

export default AboutMe;
